DROP TABLE IF EXISTS `bbc_account`;
CREATE TABLE `bbc_account` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` bigint(20) unsigned DEFAULT '0',
  `username` varchar(255) DEFAULT NULL,
