INSERT INTO `bbc_email_text` VALUES (1,'Dear [name], thank for your comment','Dear [name]\r\n\r\n[date]\r\nTitle   : [title]\r\nLink    : [link]\r\nName    : [name]\r\nEmail   : [email]\r\nWebsite : [website]\r\nComment :\r\n   [message]\r\n\r\n\r\n[status]',1),(2,'Password reminder','Dear [name],\r\n\r\n/* INFORMATION LOGIN */\r\nUSERNAME : [username]\r\nPASSWORD: [password]\r\n\r\nThank You for stay in touch with us.',1),(3,'Link Validasi Pendaftaran','dear [name],\r\n\r\nProses pendaftaran telah selesai, account akan dibuat setelah anda mengakses halaman di bawah ini :\r\n[validateLink]\r\n\r\nApabila link diatas tidak bisa diakses, anda bisa mengaksesnya dengan cara kopi text di atas kemudian paste link tsb di bowser untuk mengaksesnya',1),(4,'Terimakasih, data anda telah kami simpan','dear [name],\r\n\r\nTerimakasih data diri pendaftaran anda telah kami simpan. Kami akan menghubungi anda secepatnya.\r\n\r\nBerikut data diri yang telah anda masukkan :\r\n[memberdata]',1),(5,'Pendaftaran Selesai, Account Telah Kami Buat','dear [name],\r\n\r\nTerimakasih proses pendaftaran telah selesai, data anda akan kami simpan sekaligus account untuk member telah kami buatkan\r\nBerikut Data Diri Yang Telah anda masukkan :\r\n[memberdata]\r\n\r\n/* LOGIN INFORMATION */\r\nUSERNAME :  [username]\r\nPASSWORD : [password]\r\nGunakan account informasi di atas untuk login ke situs, password di atas bersifat temporary. Anda bisa mengganti password sesuai keinginan anda dengan cara login ke situs kami.',1),(6,'New entry has been posted by user','[title]\r\n\r\n[intro]\r\n\r\n[status]\r\n[link]',1),(7,'Download Your File ([title])','Silahkan download file anda dengan klik link dibawah ini\r\n[url]\r\n\r\n',1),(8,'Thank for your concern','Thank you [name] for your concern to our site.\r\n\r\n[detail]\r\nYour message :\r\n [message]\r\n\r\nyour email has been sent to our mailbox, and will be process in 1x24hours.\r\n',1),(13,'thank you [name] for your time','dear [name],\r\n\r\nThank you for your time to fulfill our form survey, we will take all incoming opinions and suggestions from visitor as our priority reference in expanding our offering services.\r\n\r\nThank You',1);
