DROP TABLE IF EXISTS `bin`;
CREATE TABLE `bin` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` bigint(20) unsigned DEFAULT '0',
  `level_id` int(11) unsigned DEFAULT NULL,
  `username` varchar(80) DEFAULT NULL,
  `name` varchar(120) DEFAULT NULL,
  `upline_id` bigint(20) unsigned NOT NULL DEFAULT '0',
  `sponsor_id` bigint(20) unsigned NOT NULL DEFAULT '0',
  `total_downline` bigint(20) unsigned DEFAULT '0' COMMENT 'brp orang yg ada di bawah nya',
  `total_left` bigint(20) unsigned DEFAULT '0' COMMENT 'jumlah titik di kaki kiri',
  `depth_left` bigint(20) DEFAULT '0' COMMENT 'kedalaman member dibawahnya di kaki kiri',
  `total_right` bigint(20) unsigned DEFAULT '0' COMMENT 'jumlah titik di kaki kanan',
  `depth_right` bigint(20) DEFAULT '0' COMMENT 'kedalaman member dibawahnya di kaki kanan',
  `total_sponsor` bigint(20) unsigned DEFAULT '0' COMMENT 'jumlah member yg di sponsori',
  `depth_upline` bigint(20) DEFAULT '0' COMMENT 'berapa kedalaman level member jika di lihat dari jalur titik (dari root)',
  `depth_sponsor` bigint(20) DEFAULT '0' COMMENT 'berapa kedalaman level member jika di lihat dari jalur sponsor (dari root)',
  `position` tinyint(1) unsigned DEFAULT '0' COMMENT '0=left, 1=right',
  `balance` bigint(20) unsigned DEFAULT '0',
  `serial_id` bigint(20) unsigned NOT NULL DEFAULT '0',
  `serial_pin` varchar(60) DEFAULT NULL,
  `serial_type_id` int(11) unsigned DEFAULT '0',
  `location_id` int(11) unsigned NOT NULL,
  `location_name` varchar(255) NOT NULL,
  `location_address` varchar(255) NOT NULL DEFAULT '',
  `location_latlong` varchar(255) DEFAULT '',
  `bank_name` varchar(120) DEFAULT '',
  `bank_no` varchar(120) DEFAULT '',
  `tasking` varchar(120) DEFAULT '' COMMENT 'pekerjaan yang akan dijalankan',
  `done` tinyint(1) DEFAULT '0' COMMENT 'selesai di proses crawling atau belum',
  `created` datetime DEFAULT CURRENT_TIMESTAMP,
  `updated` datetime DEFAULT '0000-00-00 00:00:00' ON UPDATE CURRENT_TIMESTAMP,
