DROP TABLE IF EXISTS `bin_location_member`;
CREATE TABLE `bin_location_member` (
  `list_id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` bigint(20) unsigned DEFAULT '0',
  `bin_id` bigint(20) unsigned DEFAULT '0',
  `location_id` int(11) unsigned DEFAULT NULL,
  PRIMARY KEY (`list_id`),
  KEY `user_id` (`user_id`),
  KEY `bin_id` (`bin_id`),
  KEY `location_id` (`location_id`),
  CONSTRAINT `bin_location_member_ibfk_1` FOREIGN KEY (`bin_id`) REFERENCES `bin` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `bin_location_member_ibfk_2` FOREIGN KEY (`location_id`) REFERENCES `bin_location` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;

