DROP TABLE IF EXISTS `bin_matching`;
CREATE TABLE `bin_matching` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `bin_id` bigint(20) unsigned DEFAULT '0',
  `wait_bin_id` bigint(20) unsigned DEFAULT '0',
  `pair_bin_id` bigint(20) unsigned DEFAULT '0',
  `paired` tinyint(1) DEFAULT '0' COMMENT '0=waiting, 1=paired, 2=flushout',
  `position` tinyint(1) DEFAULT '0',
  `create_day` int(11) DEFAULT '0',
  `create_month` int(11) DEFAULT '0',
  `create_year` int(11) DEFAULT '0',
  `created` datetime DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  KEY `bin_id` (`bin_id`),
  KEY `wait_bin_id` (`wait_bin_id`),
  KEY `paired` (`paired`),
  KEY `create_day` (`create_day`),
  KEY `create_month` (`create_month`),
  KEY `create_year` (`create_year`),
  KEY `position` (`position`),
  CONSTRAINT `bin_matching_ibfk_1` FOREIGN KEY (`bin_id`) REFERENCES `bin` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `bin_matching_ibfk_2` FOREIGN KEY (`wait_bin_id`) REFERENCES `bin` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='table untuk menyimpan registrant yang dipasangkan atau biasa disebut titik menunggu';

DROP TABLE IF EXISTS `bin_message`;
CREATE TABLE `bin_message` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `par_id` bigint(20) unsigned DEFAULT '0' COMMENT 'menjawab dari id',
  `main_id` bigint(20) unsigned NOT NULL DEFAULT '0' COMMENT 'subject utama dari id',
  `from_id` bigint(20) unsigned DEFAULT '0',
  `from_name` varchar(255) DEFAULT NULL,
  `to_id` bigint(20) unsigned DEFAULT '0',
  `to_name` varchar(255) DEFAULT NULL,
  `title` varchar(255) DEFAULT NULL,
  `detail` text,
  `child` int(11) NOT NULL DEFAULT '1',
  `created` datetime DEFAULT CURRENT_TIMESTAMP,
  `updated` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' ON UPDATE CURRENT_TIMESTAMP,
  `readed` tinyint(1) DEFAULT '0',
  PRIMARY KEY (`id`),
  KEY `par_id` (`par_id`),
  KEY `main_id` (`main_id`),
  KEY `from_id` (`from_id`),
  KEY `to_id` (`to_id`),
  KEY `readed` (`readed`),
  CONSTRAINT `bin_message_ibfk_1` FOREIGN KEY (`from_id`) REFERENCES `bin` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `bin_message_ibfk_2` FOREIGN KEY (`to_id`) REFERENCES `bin` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='table message inbox antar member dalam jaringan';

DROP TABLE IF EXISTS `bin_reward`;
CREATE TABLE `bin_reward` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(255) DEFAULT '',
  `image` varchar(255) DEFAULT '',
  `images` text,
  `description` text,
  `amount` int(11) DEFAULT '0',
  `total_sponsor` int(11) DEFAULT '0' COMMENT 'minimum total sponsor',
  `total_left` int(11) DEFAULT '0' COMMENT 'minimum total left',
  `total_right` int(11) DEFAULT '0' COMMENT 'minimum total right',
  `level_id` int(11) DEFAULT '0' COMMENT '0=any level from bin_level',
  `serial_type_id` int(11) DEFAULT '0' COMMENT '0=any type from bin_serial_type',
  `accumulate` tinyint(1) DEFAULT '0' COMMENT '0=non accumulate, 1=accumulate',
  `active` tinyint(1) DEFAULT '1',
  PRIMARY KEY (`id`),
  KEY `amount` (`amount`),
  KEY `active` (`active`)
) ENGINE=InnoDB AUTO_INCREMENT=8 DEFAULT CHARSET=utf8;

