DROP TABLE IF EXISTS `bin_reward_member`;
CREATE TABLE `bin_reward_member` (
  `list_id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` bigint(20) unsigned DEFAULT '0',
  `bin_id` bigint(20) unsigned DEFAULT '0',
  `username` varchar(255) DEFAULT '',
  `reward_id` int(11) unsigned DEFAULT '0',
  `reward_name` varchar(255) DEFAULT '',
  `reward_amount` int(11) DEFAULT '0' COMMENT 'nilai reward saat pencapaian',
  `total_sponsor` int(11) DEFAULT '0',
  `total_left` int(11) unsigned DEFAULT '0',
  `total_right` int(11) unsigned DEFAULT '0',
  `accumulate` tinyint(1) DEFAULT '0' COMMENT '0=passby, 1=accumulate',
  `received` tinyint(1) DEFAULT '0' COMMENT '0=berhak atas reward, 1=sudah menerima reward, 2=potensi mendapat reward',
  `created` datetime DEFAULT CURRENT_TIMESTAMP,
  `updated` datetime DEFAULT '0000-00-00 00:00:00' ON UPDATE CURRENT_TIMESTAMP,
  `active` tinyint(1) DEFAULT '1' COMMENT 'jika perusahaan meng-klaim maka ubah ke 0',
  PRIMARY KEY (`list_id`),
  KEY `user_id` (`user_id`),
  KEY `bin_id` (`bin_id`),
  KEY `username` (`username`),
  KEY `reward_id` (`reward_id`),
  KEY `total_sponsor` (`total_sponsor`),
  KEY `total_left` (`total_left`),
  KEY `total_right` (`total_right`),
  KEY `accumulate` (`accumulate`),
  KEY `received` (`received`),
  CONSTRAINT `bin_reward_member_ibfk_1` FOREIGN KEY (`bin_id`) REFERENCES `bin` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `bin_reward_member_ibfk_2` FOREIGN KEY (`reward_id`) REFERENCES `bin_reward` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='Daftar member yang menerima reward';

DROP TABLE IF EXISTS `bin_serial`;
CREATE TABLE `bin_serial` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `code` varchar(60) NOT NULL DEFAULT '',
  `pin` varchar(60) NOT NULL COMMENT 'password dari serial yg dicreate',
  `type_id` int(10) unsigned DEFAULT '0',
  `user_id` bigint(20) unsigned DEFAULT '0' COMMENT 'ID dr bbc_user',
  `user_bin_id` bigint(20) unsigned DEFAULT '0' COMMENT 'diambil id dari tabel bin',
  `user_date` datetime DEFAULT '0000-00-00 00:00:00',
  `buyer_id` bigint(20) unsigned DEFAULT '0' COMMENT 'ID dr bbc_user',
  `buyer_bin_id` bigint(20) unsigned DEFAULT '0' COMMENT 'diambil id dari tabel bin',
  `buyer_date` datetime DEFAULT '0000-00-00 00:00:00',
  `created` datetime DEFAULT CURRENT_TIMESTAMP,
  `expired` date DEFAULT '0000-00-00',
  `used` tinyint(1) unsigned DEFAULT '0',
  `active` tinyint(1) unsigned DEFAULT '0' COMMENT 'saat digenerate otomatis value 1. jika hilang atau rusak berarti 0',
  PRIMARY KEY (`id`),
  UNIQUE KEY `code` (`code`),
  KEY `type_id` (`type_id`),
  KEY `user_id` (`user_id`),
  KEY `user_bin_id` (`user_bin_id`),
  KEY `buyer_id` (`buyer_id`),
  KEY `buyer_bin_id` (`buyer_bin_id`),
  KEY `used` (`used`),
  KEY `active` (`active`),
  CONSTRAINT `bin_serial_ibfk_1` FOREIGN KEY (`type_id`) REFERENCES `bin_serial_type` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COMMENT='berisi daftar serial yang digenerate oleh programmer yg akan diupdate saat serial tersebut dipakai/aktivasi. (berisi siapa yg beli serial dan siapa yg menggunakan serial)';

